import React, { useState, useEffect } from 'react';

import Profile from './Components/Profile';
import Projects from './Components/Projects';
import Skills from "./Components/Skills";
import Search from "./Components/Search";
// Main App Component
export default App = () => {
  const [profileData, setProfileData] = useState(null);
  const [projects, setProjects] = useState([]);
  const [skills, setSkills] = useState({});
  const [currentView, setCurrentView] = useState('profile');
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [dataVersion, setDataVersion] = useState(0); // Used to trigger data refresh

  useEffect(() => {
    const fetchAllData = async () => {
      try {
        setLoading(true);
        const profileRes = await fetch('http://localhost:5000/api/profile');
        const projectsRes = await fetch('http://localhost:5000/api/projects');
        const skillsRes = await fetch('http://localhost:5000/api/skills');

        if (!profileRes.ok || !projectsRes.ok || !skillsRes.ok) {
          throw new Error('Failed to fetch data from one or more endpoints.');
        }

        const profileData = await profileRes.json();
        const projectsData = await projectsRes.json();
        const skillsData = await skillsRes.json();

        setProfileData(profileData);
        setProjects(projectsData);
        setSkills(skillsData);
      } catch (err) {
        console.error("Error fetching data:", err);
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchAllData();
  }, [dataVersion]); 

  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-screen bg-gray-900 text-white">
        <div className="text-xl font-medium">Loading...</div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="flex items-center justify-center min-h-screen bg-gray-900 text-red-400">
        <div className="text-xl font-medium">Error: {error}</div>
      </div>
    );
  }

  const handleDataRefresh = () => {
    setDataVersion(prev => prev + 1);
    setCurrentView('projects'); 
  };

  const renderContent = () => {
    switch (currentView) {
      case 'profile':
        return <Profile profile={profileData} />;
      case 'projects':
        return <Projects projects={projects} />;
      case 'skills':
        return <Skills skills={skills} />;
      case 'addProject':
        return (
          <div className="text-center py-10">
            <h2 className="text-2xl font-bold mb-4">Add Project</h2>
            <p className="text-gray-400">Add Project form goes here.</p>
          </div>
        );
      default:
        return <Profile profile={profileData} />;
    }
  };

  return (
    <div className="bg-gray-950 min-h-screen text-gray-200 font-sans">
      <header className="bg-gray-900 shadow-lg sticky top-0 z-50">
        <nav className="container mx-auto px-4 py-4 flex flex-col sm:flex-row justify-between items-center space-y-4 sm:space-y-0">
          <h1 className="text-2xl font-bold text-blue-400">
            {profileData?.name || "Portfolio"}
          </h1>
          <div className="flex flex-wrap justify-center space-x-2 sm:space-x-4">
            <button
              onClick={() => setCurrentView('profile')}
              className={`px-4 py-2 rounded-lg font-medium transition-all ${
                currentView === 'profile' ? 'bg-blue-600 text-white shadow-lg' : 'bg-gray-700 hover:bg-gray-600'
              }`}
            >
              Profile
            </button>
            <button
              onClick={() => setCurrentView('projects')}
              className={`px-4 py-2 rounded-lg font-medium transition-all ${
                currentView === 'projects' ? 'bg-blue-600 text-white shadow-lg' : 'bg-gray-700 hover:bg-gray-600'
              }`}
            >
              Projects
            </button>
            <button
              onClick={() => setCurrentView('skills')}
              className={`px-4 py-2 rounded-lg font-medium transition-all ${
                currentView === 'skills' ? 'bg-blue-600 text-white shadow-lg' : 'bg-gray-700 hover:bg-gray-600'
              }`}
            >
              Skills
            </button>
            <button
              onClick={() => setCurrentView('addProject')}
              className={`px-4 py-2 rounded-lg font-medium transition-all ${
                currentView === 'addProject' ? 'bg-emerald-600 text-white shadow-lg' : 'bg-gray-700 hover:bg-gray-600'
              }`}
            >
              + Add Project
            </button>
          </div>
        </nav>
      </header>
      <main className="container mx-auto px-4 py-8">
        {renderContent()}
      </main>
    </div>
  );
};
